def Harness_to_Internal (ii, one_separ_harn, Read_Basic_Module, only_index_Basic_Module, For_Basic_Module_int):
    Mistakes_harn = [] #Масив для помилок
    Rezult = [] #Результат розбивки вязок

    #Роблю масив з індексами з one_separ_harn
    Index_one_separ_harn = []
    for i in one_separ_harn:
        Index_one_separ_harn.append(i[4])

    #Створюю Basic_Module під вязку
    Harn_Basic_Module = []
    for i in Read_Basic_Module:
        if i[3] in Index_one_separ_harn:
            Harn_Basic_Module.append(i)

    #Створюю For_Basic_Module_int але для Harn_Basic_Module
    Harn_For_Basic_Module_int = []
    uniq_group_BM = []  # масив з унікальними групами BM
    for i in Harn_Basic_Module:
        if i[1] not in uniq_group_BM:
            uniq_group_BM.append(i[1])
    for i in uniq_group_BM:
        one_group_BM = []  # масив з окремою групою
        for k in Harn_Basic_Module:
            if i == k[1]:
                one_group_BM.append(k)
        uniq_module_in_one_group_BM = []  # масив з унікальними інтерналами під групу
        for k in one_group_BM:
            if k[0] not in uniq_module_in_one_group_BM:
                uniq_module_in_one_group_BM.append(k[0])
        for k in uniq_module_in_one_group_BM:
            range_internal = []  # Масив з інтерналами
            for j in one_group_BM:
                if k == j[0]:
                    range_internal.append(j)
            uniq_index_in_range_internal = []  # кількість унікальних умов під інтернал
            for j in range_internal:
                if j[2] not in uniq_index_in_range_internal:
                    uniq_index_in_range_internal.append(j[2])
            prev_For_Basic_Module_int = []
            prev_For_Basic_Module_int.append(k)
            prev_For_Basic_Module_int.append(len(uniq_index_in_range_internal))
            prev_For_Basic_Module_int.append(i)
            Harn_For_Basic_Module_int.append(prev_For_Basic_Module_int)

            #Перевірка на замовлення індексів одночасно що прописані через або
            for j in uniq_index_in_range_internal:
                check_index = []
                for s in range_internal:
                    if j == s[2]:
                        check_index.append(s)
                if len(check_index) > 1:
                    for n in check_index:
                        Mistakes_harn.append(['Ordered_more_than_one_index_prescribed_as_OR: ' + str(ii) + ' ' + str(n[0]) + ' ' + str(n[3]) + ' ' + str(n[2]) + ' ' + str(n[1])])

    #Відкидую невиконані повністю умови
    Rel_Harn_For_Basic_Module_int = []
    for i in Harn_For_Basic_Module_int:
        if i in For_Basic_Module_int:
            Rel_Harn_For_Basic_Module_int.append(i)

    #Проходжу циклом щоб вибрати найбільшу умову
    uniq_realiz_g = [] #Масив з унікальними реалізованими групами
    for i in Rel_Harn_For_Basic_Module_int:
        if i[2] not in uniq_realiz_g:
            uniq_realiz_g.append(i[2])
    for i in uniq_realiz_g: # Проходжу циклом по унікальними реалізованими групам
        one_unig_r_g = [] #масив з реалізованими інт під одну групу
        for k in Rel_Harn_For_Basic_Module_int: # проходжу циклом по реаліз інт для відбору під одну групу
            if k[2] in i:
                one_unig_r_g.append(k)
        one_unig_r_g_mas_max = [] # Масив значень максимумів в групі
        for k in one_unig_r_g: #проходжу циклом по масив з реалізованими інт під одну групу
            one_unig_r_g_mas_max.append(k[1])
        max_mas_rel = [] #Масив реалізованих максимумів
        for k in one_unig_r_g:
            if k[1] == max(one_unig_r_g_mas_max):
                max_mas_rel.append(k)
        for k in max_mas_rel: # проходжу циклом по реалізованих максимумах щоб добавити два чи більше якшо замовились
            Rezult_pre = []
            Rezult_pre.append(ii)
            Rezult_pre.append(k[2])
            Rezult_pre.append(k[0])
            Rezult.append(Rezult_pre)

        #Добавляю в помилки якщо заказалось більше двох інтерналів під групу
        if len(max_mas_rel) > 1:
            for k in max_mas_rel:
                Mistakes_harn.append(['More_than_one_internal_in_one_group: ' + str(ii) + ' ' + str(k[2]) + ' ' + str(k[0])])

    # Перевірка на відсутні індекси в бейсік модулі
    for i in Index_one_separ_harn:
        if i not in only_index_Basic_Module:
            Mistakes_harn.append(['Index_are_in_Harnesses_but_absent_in_Basic_Module: ' + str(ii) + ' ' + str(i)])

    # Перевірка чи всі індекси реалізувались
    Harn_BM_index_group = [] # Масив індекс група з бейсіка під вязку
    for i in Harn_Basic_Module: # З бейсіка під вязку витягую індекс - група
        Harn_BM_index_group_prev = []
        Harn_BM_index_group_prev.append(i[3])
        Harn_BM_index_group_prev.append(i[1])
        if Harn_BM_index_group_prev not in Harn_BM_index_group:
            Harn_BM_index_group.append(Harn_BM_index_group_prev)
    Harn_realiz_BM_index_group = [] # Масив індекс група з реалізованих інтерналів під явязку
    Rezult_int = [] # Масив з реалізованих інтерналів
    for i in Rezult:
        Rezult_int.append(i[2])
    for i in Read_Basic_Module:
        if i[0] in Rezult_int:
            Harn_realiz_BM_index_group_prev = []
            Harn_realiz_BM_index_group_prev.append(i[3])
            Harn_realiz_BM_index_group_prev.append(i[1])
            if Harn_realiz_BM_index_group_prev not in Harn_realiz_BM_index_group:
                Harn_realiz_BM_index_group.append(Harn_realiz_BM_index_group_prev)
    for i in Harn_BM_index_group:
        if i not in Harn_realiz_BM_index_group:
            Mistakes_harn.append(['Unrealized_index: ' + str(ii) + ' ' + str(i[0]) + ' ' + str(i[1])])

    return Rezult, Mistakes_harn

